INSERT INTO `project` VALUES ('ABC','West River, Sheet Harbour, Brook Trout','This project examined the estuarine migration, behaviour, habitat use and general ecology of brook charr while in estuarine and coastal habitats. This was a two year project (2009 & 2010) and ran concurrent to the West River Sheet Harbour Atlantic Salmon smolt tracking project (WRS).','Halfyard, E.A., MacMillan, J. 2009. Assessing estuarine ecology of anadromous brook charr in the West River, Sheet Harbour.','Eddie Halfyard','NS Fisheries','eahalfyard@hotmail.com','http://members.oceantrack.org/data/discovery/ABC.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-62.61,-62.61,44.95,44.95,0,95.479,'OTN-Global'),('ABRS','Algoa Bay raggedtooth shark tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Smale, M. yyyy. Alboa Bay raggedtooth shark tracking.','Malcolm Smale','Bayworld','msmale@bayworld.co.zâ€‹a','http://members.oceantrack.org/data/discovery/ABRS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',18.632165,25.83,-33.78743,-34.78497,0,95.479,'OTN-Global'),('AMZRC','Amazing Race Lobster Tagging','In the Northwest Atlantic, the Ocean Tracking Network (OTN), in collaboration with Dalhousie University, is using an acoustic telemetry infrastructure to monitor the habitat use, movements, and survival of American Lobster. Project sponsered by the Amazing Race Television Program.','Whoriskey, F., Davis, B. 2013. Ocean Tracking Network Nova Scotia Lobster Tracking','UNKNOWN','DAL','UNKNOWN','http://members.oceantrack.org/data/discovery/AMZRC.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-63.41,-63.41,44.37,44.37,0,95.479,'OTN-Global'),('BDK','Overwinter biology, migrations, and carryover effects of Bras dâ€™Or Atlantic salmon populations','Although they have the capacity to survive a first reproductive attempt, post-spawning Atlantic salmon (or kelts) are found in a nutritionally depleted state and their subsequent migratory decisions and reconditioning represent a critical phase of their life history. Kelts native to the Bras dâ€™Or Lakes (BdL), a unique brackish-water inland sea of Cape Breton Island, have three options: i. remaining in their natal river for the winter; ii. migrating immediately downriver to this vast estuary and overwinter there; or iii. migrating immediately downriver, through the estuary, and directly to sea. Despite limited knowledge on the kelt life stage, post-spawning condition is believed to influence decisions about migration timing and strategy, with implications for longer-term survival. The main objectives of this research project are: 1. to document kelts habitat use and residency pattern in the Bras dâ€™Or Lakes; and 2. to evaluate the influence of kelts post-spawning condition on migration behaviour and survival. In order to do so, in fall 2014 and 2015, a total of 61 kelts were surgically implanted with acoustic transmitters and bio-sampled for indicators of their physiological state. Ultimately, this research will provide new insights into the role of the Bras dâ€™Or Lakes system in Atlantic salmon life cycle, and more broadly to factors underlying kelts mortality.','Crossin, G.T., Hatcher, B.G., Sheng, J. 2014. [Overwinter biology, migrations, and carryover effects of Bras dâ€™Or Atlantic salmon populations]','Bruce Hatcher','OTN','bruce_hatcher@cbu.ca','http://members.oceantrack.org/data/discovery/BDK.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-60.93,-60.78,46.18,46.08,0,95.479,'OTN-Global'),('BFTDK','Decadal tracking of Atlantic Bluefin Tuna','In 1930-1950, bluefin tuna were commercially fished in Denmark and Sweden. Landings were several hundred tonnes per year, with a peak of 2000t in Sweden in 1942. Fishing continued in the next two decades and then it gradually disappeared. Sport fishing for bluefin tuna in the Kattegat and the Sound continued until the 1960s. But then, bluefin tuna catches became increasingly rare. After decades of absence, bluefin tuna have recently been sighted again in the Northeastern Atlantic, inter alia off the coast of BohuslÃ¤n and in the Skagerrak and Kattegat. In 2016 and 2017, large schools of several hundred large individuals were observed. These adult fish hunted mackerel and herring during late summer and autumn. The reasons for the return and origin of the bluefin tuna in the North Sea-Skagerrak-Kattegat are unknown. This project will use electronic tags to help understand its migration patterns and behavior, avoid unwanted bycatch and support sustainable management of the stock. Attaching long life acoustic tags holds the potential to observe transatlantic migration as well as repeatability of the migratory pattern, by using the OTN network of receivers.','Aarestrup, K. 2018. Decadal tracking of Atlantic Bluefin Tuna','Kim Aarestrup','DTU','kaa@aqua.dtu.dk','http://members.oceantrack.org/data/discovery/BFTDK.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',10.3483013,10.6481282,57.7519078,57.6409444,0,95.479,'OTN-Global'),('BFTTAG','Estimating Bluefin tuna post release mortality, fish size and fidelity using high resolution multi-beam sonar and acoustic tags.','Bluefin tuna and many other species are hooked and released in recreational fisheries around the world. The challenge is to determine the size of the fish and what actually happens after the fish are released. Traditionally very expensive archival and satellite tags have been used to monitor movement and estimate post release mortality. However, new high resolution multi-beam sonar is capable of visually tracking tuna detected with acoustic tags at distances of up to 1000m in real time while actively transmitting. This provides a mechanism of tracking the fish and monitoring its behaviour immediately upon it release. The sonar system is also capable of estimating the size of individual targets to within a few cm, while they are on the line or being run prior to release. Because the tags have a battery life 3 years or more and are detectable by the OTN arrays, movements of tagged fish may be passively monitored by the arrays and actively monitored by our team when they return to the same survey areas for several years. The objective of the project is to collaborate with the fishing industry (recreational and commercial) to estimate the size of bluefin tuna while still in the water and to estimate their post release mortality using the much less expensive acoustic tags and multi-beam sonar. Subsequent observations would be made if the fish returned to the fishing area. The technology will allow the monitoring of fish behaviour immediately after release. Recent studies using this sonar technology have clearly illustrated the detection of bluefin tuna and estimated their swimming speed and inter-spatial distance between fish when aggregated.','Melvin, G.D. 2017. Estimating Bluefin tuna post release mortality, fish size and fidelity using high resolution multi-beam sonar and acoustic tags.','Gary Melvin','DFO-MR','gary.melvin@dfo-mpo.gc.ca','http://members.oceantrack.org/data/discovery/BFTTAG.htm','DETECTIONS; ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-67.8,-52.5,52.3,45.6,0,95.479,'OTN-Global'),('BOOABS','Buoys of Opportunity - Arctic Barrow Strait','Canadaâ€™s Department of Fisheries and Oceans deploys moorings with scientific monitoring equipment for biological and oceanographic reasons strategically in various parts of its waters. In the Arctic, buoys are typically outfitted with sensors providing yearlong records of current, temperature, salinity, and ice drift, all of which are used in climate change research. These moorings are frequently deployed in locations that are of great interest for monitoring a variety of acoustically tagged animals. In partnership with DFO, OTN has placed acoustic receivers on many of these moorings, including the BOOABS deployment in the Barrow Strait of the Northwest Passage. This area is important to monitor as changes in ice cover and warming of the sea will cause increased shipping and fishing activity in the passage, which is home to ecologically important species such as the Greenland shark. The warming may also enable the colonization of Arctic areas with more southern species, and allow the movements of animals between the Atlantic and Pacific Oceans.','Bartholette, J., Richards, C., Whoriskey, F. 2018. Buoys of Opportunity - Arctic Barrow Strait','Fred Whoriskey','DFO-BIO','fwhoriskey@dal.ca','http://members.oceantrack.org/data/discovery/BOOABS.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-97.8160075,-97.7839927,74.3863364,74.380329,0,95.479,'OTN-Global'),('BOONSW','Buoys of Opportunity - NOAA Salmon Whale','Increasingly, passive acoustic monitoring systems (PAMs) including moored buoys are being deployed to document the presence of whales and other species that may make sounds for communication. These buoys are frequently placed across possible migration routes that a variety of tagged marine animals might follow, making them ideal sites for the addition of acoustic receivers to detect the tags. This deployment is a partnership between OTN and NOAA\'s Northeast Fisheries Science Center (NEFSC) passive acoustic monitoring and salmon teams, to integrate fish telemetry into existing NEFSC Whale passive acoustic moorings. OTN\'s buoys of opportunity loaner program aims to increase the number and geographic distribution of tag detections within the North Atlantic. This deployment focuses on the rich environment off Cape Cod and includes deep water mooring stations.','Whoriskey, F. 2016. Buoys of Opportunity - NOAA Salmon Whale','Fred Whoriskey','NOAA-NMFS-NEFSC','fwhoriskey@dal.ca','https://www.nefsc.noaa.gov/salmon/;https://www.nefsc.noaa.gov/psb/acoustics/','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-70.6876673,-69.9285511,42.0823174,41.5149887,0,95.479,'OTN-Global'),('BQEEL','Bay of Quinte Eel Tracking','The Ontario Ministry of Natural Resources and Forestry - Lake Ontario Management Unit (LOMU) is interested in learning more about the movements of American Eels, Muskellunge and Lake Sturgeon in and out of the Lake Ontario / Bay of Quinte system. Since June 2015, LOMU has worked with the Dr. Bruce Tufts (Freshwater Fisheries Conservation lab at Queenâ€™s University) and Dr. Mark Ridgway (OMNRF) to deploy and maintain receiver arrays throughout the Bay of Quinte and eastern Lake Ontario. Maturing American Eel migrate out of the Bay of Quinte at the start of their journey to the spawning grounds located in the Sargasso Sea (North Atlantic Ocean). This project will provide information on the timing of their departure and potentially be tracked as they move down the St. Lawrence River system. American Eel are listed as endangered under Ontarioâ€™s Endangered Species Act, 2007. Improved understanding of their migration towards the spawning grounds will increase fisheries managers ability to provide additional protection to these fish.','Mathers, A. 2015. Bay of Quinte Eel Tracking','Alastair Mathers','OMNRF','alastair.mathers@ontario.ca','http://glatos.glos.us/home/project/BQEEL','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-77.42,-76.7,44.19,44.01,0,95.479,'OTN-Global'),('BRFT','Breede River fish tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','McCord, M., Lamberth, S. Kerwath, S., Da Silva, C., Erasmus, C., et al. yyyy. Breede River fish tracking.','Meaghan McCord','SASC','meag@sharkconservancy.org','http://members.oceantrack.org/data/discovery/BRFT.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',20.97,20.97,-34.45,-34.45,0,95.479,'OTN-Global'),('CBT','Movements of Brown Trout in the Saint John River.','Originating from Europe, Brown Trout, Salmo trutta, were introduced to New Brunswickâ€™s waters in 1921, in the Loch Lomond watershed.  Brown Trout were stocked in various New Brunswick lakes until the mid-1990â€™s by government personnel.  Brown Trout continue to persist in the Loch Lomond system and the Saint John River, specifically, the Meduxnekeg River, where Brown Trout are a common target recreational species.  There is little information on Brown Trout populations in New Brunswick and recent information suggests that other reproducing populations may be occurring in the lower Saint John River.  The extent of the Brown Trout dispersal is unknown.  Electrofishing surveys will be conducted in selected streams flowing into the lower Saint John River, Belleisle Bay, Kennebacasis Bay, Loch Lomond, and the Meduxnekeg River.    Fish collected will be identified, measured for length and weight, and released. Brown Trout from each site will receive a small fin clip for genetic analysis.  Brown Trout of an appropriate size will be surgically implanted with a Vemco V13 acoustic tag.  The objectives for this project are to; 1) to determine the seasonal movements of Brown Trout in the Saint John River, 2) to investigate distribution and abundances, and 3) to analyze the genetic diversity across sites.','Curry, A., Gautreau, M. 2016. [Movements of Brown Trout, Salmo trutta, in the Saint John River, New Brunswick]','Allen Curry','UNB-F','racurry@unb.ca','http://members.oceantrack.org/data/discovery/CBT.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-67,-65.5,47.4015978,45,0,95.479,'OTN-Global'),('CCK','Cockburn Sound WA','Forty-nine VR2 recievers were deployed in a double gate design to detect movement/migration of pink snapper into and out of Cockburn Sound spawning aggregations.','UNKNOWN','David Fairclough','WA Fish','david.fairclough@fish.wa.gov.au','http://members.oceantrack.org/data/discovery/CCK.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',115.65,115.74,-32.15,-32.19,0,95.479,'OTN-Global'),('CESB','CMRC European Sea Bass Tracking','For many marine migratory fish, comparatively little is known about the movement of individuals rather than the population. Yet, such individual-based movement data is vitally important to understand variability in migratory strategies and fidelity to foraging locations. A case in point is the economically important European sea bass (Dicentrarchus labrax L.) that inhabits coastal waters during the summer months before migrating offshore to spawn and overwinter. Beyond this broad generalisation we have very limited information on the movements of individuals at coastal foraging grounds. We used acoustic telemetry to track the summer movements and seasonal migrations of individual sea bass in a large tidally and estuarine influenced coastal environment. We found that the vast majority of tagged sea bass displayed long-term residency (mean, 167 days) and inter-annual fidelity (93 percent return rate) to specific areas. We describe individual fish home ranges of 3km or less, and while fish clearly had core resident areas, there was movement of fish between closely located receivers. The combination of inter-annual fidelity to localised foraging areas makes sea bass very susceptible to local depletion; however, the designation of protected areas for sea bass may go a long way to ensuring the sustainability of this species. (Doyle TK, Haberlin D, Clohessy J, Bennison A and Jessopp M. 2017. Localised residency and inter-annual fidelity to coastal foraging areas may place sea bass at risk to local depletion. Sci. Rep. 7: 45841. DOI: 10.1038/srep45841)','Doyle, T. 2013. Coastal & Marine Research Centre European Sea Bass Tracking','Tom Doyle','CMRC','t.doyle@ucc.ie','http://www.marei.ie/','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-8.32,-8.2,51.91,51.86,0,95.479,'OTN-Global'),('CONRH','Movement of Alewife in the Concord and Merrimack River, MA','We are using surgically tagging of Alewife to conduct a pre-restoration study to look at migration patterns in the Concord and Merrimack Rivers.  Fish will be moved above dams that currently have no available passage to gather a beter understanding of how migration will occurs once fish passage has been acheived.','Bailey, M., Gahagan, B. 2017. CONRH.','Benjamin Gahagan','USFWS','ben.gahagan@state.ma.us','http://members.oceantrack.org/data/discovery/CONRH.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-71.3824909,-71.271231,42.6667599,42.607189,0,95.479,'OTN-Global'),('DAS','DSU: Atlantic sturgeon tagging','Atlantic sturgeon were plentiful along the Atlantic seaboard prior to their precipitous decline in the early 20th century.  The recent proposed ruling to grant Atlantic Sturgeon protection under the Endangered Species Act by the NMFS has increased the importance of understanding all aspects of this species\' life history.  Over 100 Atlantic sturgeon were collected utilizing new capture techniques allowing the implantation of 90 long lived acoustic transmitters in 2009 and 2010.  Standardized telemetry equipment enabled cooperation with researchers from other regions (i.e. Hudson River, Long Island Sound, North Carolina), allowing for the monitoring of an additional 39 telemetered Atlantic sturgeon and compatible receiver arrays, which aided in the determination of habitat use and coastal movements.  This research is providing a better understanding of marine movements and habitat use, thereby enabling managers in the development of conservation and recovery strategies for Atlantic sturgeon.','','Matthew W. Breece','DESU','matthewbreece@gmail.com','http://members.oceantrack.org/data/discovery/DAS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-75.02,-75.02,38.53,38.53,0,95.479,'OTN-Global'),('DCDK','Dwesa Cwebe dusky kob tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Venter, J. yyyy. Dwesa Cwebe dusky kob tracking.','Jan Venter','ECPT','jannie.ven@gmail.com','http://members.oceantrack.org/data/discovery/DCDK.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',28.895,28.91,-32.25,-32.26,0,95.479,'OTN-Global'),('DEASBT','Aliwal Shoal shark tracking','Aliwal Shoal shark tracking','Singh S., Anders D. yyyy. Blacktip and tiger shark tracking off Aliwal Shoal','Darrel Anders','DEA','danders@environment.gov.za','https://www.environment.gov.za/','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',30.82757,30.82757,-30.24398,-30.24398,0,95.479,'SAF'),('DICTWS','Gansbaai white shark tracking','The unique environmental characteristics of Gansbaai make it the ideal site to test hypotheses regarding the influence of physical oceanography, prey species distribution and the activities of cage diving vessels on great white shark behaviour. This will be the first study of its kind to quantify and establish how white sharks of different sizes and both sexes use an aggregation site that is impacted by dynamically changing environmental drivers, such as upwelling.','Towner A., Smale M. 2015. Gansbaai white shark tracking.','Alison Towner','DICT','alisontowner@gmail.com','http://members.oceantrack.org/data/discovery/DICTWS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',19.37508,19.37508,-34.63038,-34.63038,0,95.479,'SAF'),('DRMUCF','Assessing the role of estuarine impoundments and marine mammal exclusion devices on red drum movement patterns','The Indian River Lagoon (IRL) is one of the most diverse estuaries in North America and serves as critical habitat for a multitude of fish species.  One of the most economically valuable sportfish in the Indian River Lagoon is the red drum (Sciaenops ocellatus). Previous local studies of red drum document strong site fidelity, with some mature individuals residing and spawning within the lagoon year-round (Reyier et al 2011).  This behavior is uncommon in other portions of their geographic range, suggesting future abundance and harvest of red drum is partially dependent on continued spawning success within the lagoon. The Integrate-Transfer-Launch (ITL) complex impoundments located within Kennedy Space Center security zone are proven spawning sites of red drum (Garreau et al 2014).  However, recent construction of manatee exclusion bollards around culverts leading into these impoundments on roads operated by Cape Canaveral Air Force Station may be impacting movement to and from these historic spawning sites. This project proposes to use acoustic telemetry to quantify patterns of red drum movement and habitat use within the Kennedy Space Center security zone, and to assess how manatee exclusion bollards in the ITL-impoundment area potentially impact movement of red drum.  These data will be used in conjunction with bollard size and spacing, pertinent morphometric data (e.g. length, head width, body width, weight), and habitat conditions to develop optimal management strategies that minimize potential adverse effects on manatees and maximize red drum access to spawning sites, thereby helping to ensure the sustainability of this iconic fishery.','Baker, SM., Reyier, EA., Cook, GS. 2017. [Assessing the role of estuarine impoundments and marine mammal exclusion devices on red drum movement patterns]','Steven Baker','UCF','s.baker@knights.ucf.edu','http://members.oceantrack.org/data/discovery/DRMUCF.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-80.6818224,-80.6805762,28.5220621,28.5202816,0,95.479,'OTN-Global'),('ESBT','EFWC striped bass tagging','Striped bass are an important species in the Bras d\'Or Lakes where they are recreationally fished and where possible predation upon endangered Atlantic salmon smolts has caused concern. Using OTN\'s Bras d\'Or Lakes acoustic receivers, members of the Eskasoni Fish and Wildlife Commission tagged and tracked striped bass in the estuary from 2013 to better understand their habitat use.','McIsaac, A., Hatcher, B. 2013. Eskasoni Fish and Wildlife Commission striped bass tagging','Allison McIsaac','EFWC','allison@efwc.ca','http://members.oceantrack.org/data/discovery/ESBT.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-60.8,-60.8,45.95,45.95,0,95.479,'OTN-Global'),('FDT','Frisk and Dunton Tags','OTN supported the tagging of Atlantic sturgeon in Long Island Sound, New York. Recovery attempts for Atlantic sturgeon (Acipenser oxyrinchus oxyrinchus) populations in the USA have mainly involved closures of targeted fishing, but bycatch mortality from fisheries targeting other species remains a significant obstacle. Natural and fishing mortality levels are highly uncertain and difficult to separate, but quantifying spatial and temporal patterns of movements can directly inform management policies regarding fishing activity that affects sturgeon.','','Michael Frisk','SoMAS','michael.frisk@stonybrook.edu','http://members.oceantrack.org/data/discovery/FDT.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-73,-73,41,41,0,95.479,'OTN-Global'),('FPS','Inner Bay of Fundy Salmon Tracking','Smolts were collected from the Upper Salmon river (USR) in Fundy National Park in 2010 and reared to grilse stage in captive outdoor sea-cages. This project will evaluate homing success of these fish from a release site in the Inner Bay of Fundy. The smolts originate from efforts of conservation river-stocking of native strains of fry and fall parr in years past. After capture at the mouth of the USR, the smolts were transported to a commercial sea cage operated by the aquaculture industry in Back Bay NB for rearing. In addition to cage-reared smolt, a similar group of grilse reared in a Department of Fisheries and Oceans (DFO) hatchery in Mactaquac NB will be released to determine effects of smolt-grilse rearing strategy on homing success. Fish are planned to be released well inside the Inner Bay of Fundy near Fundy National Park. All fish will be tagged with an externally visible tag for detection by ongoing dive surveys on the USR if they successfully home to the river they were captured from in 2010.  To corroborate diver observations, we will deploy acoustic receivers at the mouth of USR and adjacent rivers and implant acoustic tags in a subset of the released fish to estimate homing and stray rates. As with any tagging project of this nature, results and associated conclusions are improved with increasing numbers of tagged individuals.   Recovery programs for Inner Bay of Fundy Salmon have been unsuccessful in producing suitable numbers of returning individuals yet it is unclear whether captive reared fish are being lost to various threats during marine migration or simply do not have the natural instinct to return.  This project provides valuable knowledge for salmon recovery program managers by evaluating the ability of captive-reared salmon to return to rivers they migrated from as smolt.  Results will be of particular value to a projected increasing number of salmon recovery program managers as more populations become threatened with decline. Our program is a collaborative effort between Parks Canada, DFO, The Atlantic Canada Fish Farmers Association, Memorial University of Newfoundland, Concordia University as well as the Atlantic Salmon Federation. Although this is a Parks Canada Species at Risk program, a much of the data generated will be contributing to an MSc graduate program (finishing in 2013) and associated publications.','Clarke, C., Mazerolle, D., Purchase, C., Fraser, D., Goff, T., MacDonald, D., Streight, H., House, B., Carr, C., O\'Reilly, P. 2010. An evaluation of the homing ability of captive-reared endangered Inner  Bay of Fundy Atlantic Salmon collected from the Upper Salmon River in  Fundy National Park.','Corey Clarke','PC-FNP','corey.clarke@pc.gc.ca','http://members.oceantrack.org/data/discovery/FPS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-65.05,-65.05,45.52,45.52,0,95.479,'OTN-Global'),('GEFT','Goukou Estuary fish tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Lamberth, S., Du Plessis, J., Cowley, P. yyyy. Goukou Estuary fish tracking.','Steve Lamberth','DAFF','stephenl@daff.gov.za','http://members.oceantrack.org/data/discovery/GEFT.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',21.429,21.429,-34.381,-34.381,0,95.479,'OTN-Global'),('GMRCAE','American Eel within the Restigouche and Eel River estuaries.','The overall purpose of this project is to better understand the movement of American Eel within the Restigouche and Eel River estuaries and to identify critical habitat, as each estuary is impacted by habitat alteration caused by human activity. Presently, there is little understanding of how eels move within these estuaries or how they use specific habitats, such as for feeding, protection/resting, or over-wintering. This project aims to address the gap in the available data.','Isaac, D. 2015. Identifying and Mapping Critical American Eel Habitat in the Restigouche and Eel River Estuaries','UNKNOWN','GMRC','UNKNOWN','http://www.migmaqresource.org/','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-67,-66,49,47,0,95.479,'OTN-Global'),('GMS','Gulf of Maine Sturgeon','A collaborative of researchers have been tagging and tracking movements of shortnose and Atlantic sturgeon in the Gulf of Maine. Extensive movements among rivers and long distance migrations to other parts of the East coast of the US and eastern Canada have been observed. Research objectives include determining the fidelity to river systems and identifying coastal and other marine habitats used by both species.','Zydlewski, G., Wippelhauser, G., Sulikowski, J., Kieffer, M., Kinnison, M. 2006. Gulf of Maine Sturgeon','Gail Wippelhauser','U Maine','gail.wippelhauser@maine.gov','http://members.oceantrack.org/data/discovery/GMS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-71.09,-68.72,44.82,42.76,0,95.479,'OTN-Global'),('GWS','WAFish/CSIRO','Headed by the Commonwealth Scientific and Industrial Research Organisation (CSIRO) in Australia, the aim of this project is to further our understanding of white shark (Carcharodon carcharias) movements in Australian waters. Sharks are fitted with a range of acoustic and satellite tag types to track their movements. When in range of acoustic receivers, detections will be recorded by the OTN network and Australian IMOS network of acoustic receivers deployed in Australian and New Zealand waters. This study allows us to better understand the biological and ecological factors contributing to human-shark interactions in Australia and New Zealand.','Bruce, B., Bradford, R., McAuley, R. yyyy. White shark movements - Australia.','Barry Bruce','WA Fish-CSIRO','barry.bruce@csiro.au','http://members.oceantrack.org/data/discovery/GWS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',115.59,136.07,-31.85,-35.23,0,95.479,'OTN-Global'),('HGN','NEFSC Gray Seal Distribution in US and Canadian Northwest Atlantic','Gray seal populations in U.S. waters have been increasing since the early 1990s, following a period of decline from a once plentiful population (Wood et al. 2011). Gray seals observed in U.S. waters are part of a larger northwest Atlantic stock ranging from northern parts of Canada to the southern Mid-Atlantic (Waring et al. 2016). While the majority of the population resides in Canadian waters, sightings of animals in the U.S that were branded on Sable Island, Canada, as well as satellite telemetry data from tagged animals, indicate transboundary movements of individuals. Increases in pup production at U.S. pupping colonies suggest that gray seals from Canada are supplementing U.S. gray seal populations, but rates of immigration from Canada to the U.S. are unknown. Concurrent with the increase in the gray seal population, particularly around Cape Cod and the Islands, has been an increase in the great white shark population. While great whites are a known predator of gray seals, the dynamics of their interactions are less well known. The purpose of this project is to gather acoustic and thermal transmissions from gray seals tagged on Cape Cod, Massachusetts, to provide insight to their local and international movements as well as co-occurrence with great white sharks.','Kocik, J., Skomal, G., Kimberly, M., Hayes, S. 2017. NEFSC Gray Seal Distribution in US and Canadian Northwest Atlantic','Kimberly Murray','NOAA-NMFS-NEFSC','kimberly.murray@noaa.gov','http://members.oceantrack.org/data/discovery/HGN.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-71,-70,42.5,41.5,0,95.479,'OTN-Global'),('HRFORCE','Quantifying fish-turbine interactions using new high residency acoustic electronic tagging technology','The Nova Scotia government has pledged to produce 40% of the provinces electricity from sustainable forms of energy by 2020. This plan includes the development of an instream tidal turbine array in the Bay of Fundy. The Bay of Fundy has the highest tides in the world, making it a prime site for the operation of instream tidal turbines.  Extensive environmental monitoring must be performed before the installment of an array to better understand the effect turbines could have on marine species. In 2009, the Fundy Ocean Research Center for Energy was established in Minas Passage, Nova Scotia to test instream tidal turbines. It is unknown whether the installation of turbines in Minas Passage could negatively influence the abundance of fish stocks that inhabit Minas Basin. It is important to know how tidal turbines influence the behavior of all species, but especially those currently federally listed as endangered (e.g., Atlantic salmon), since losses at the individual level could negatively affect the population (i.e. iBOF Atlantic Salmon).  Approximately 70 species of fish migrate through Minas Passage to access Minas Basin for feeding. Species abundance estimates are known for a handful of these species, including Gaspereau River Alewife, Shubenacadie River Striped Bass and Saint John River Atlantic Sturgeon. Five species of fish (Atlantic salmon, Atlantic herring, Alewife, Striped bass, and Atlantic Sturgeon) will be tagged with new High Residency (HR) fish tagging technology developed by a local NS company (Vemco). This technology can detect fish in environments with high current speeds (i.e., Minas Passage 6 m/s).  The information obtained from the HR tags will be used to determine the effects tidal turbines have at the individual level for endangered species like the Atlantic salmon, and at the population level for species with known population estimates.','Stokesbury, M.J.W., Sanderson, B., Redden, A., Hardie, D., Gibson, J., Bradford, R., Dadswell, M. 2017. Quantifying fish-turbine interactions at the Fundy Ocean Research Center for Energy (FORCE) test site using Vemco\'s new high residency acoustic tagging technology.','Michael Stokesbury','Acadia U','mike.stokesbury@acadiau.ca','http://members.oceantrack.org/data/discovery/HRFORCE.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-64.8,-63.4,44.9,45.5,0,95.479,'OTN-Global'),('IFC','Ian Fleming Cod Tagging','The emerging Atlantic cod farming industry faces the common aquaculture problem of escapes. Cod, like many cultured marine fishes, are particularly prone to escape from sea cages by biting holes in nets. Following escape, farmed cod interact with wild cod. The depleted populations of wild cod in the northwest Atlantic may be especially vulnerable to negative interactions with escapees. We are asking the question: what do farmed cod do following escape? We used acoustic telemetry to investigate behaviour (dispersal) following a simulated escape from a sea cage. Wild (locally caught) cod dispersed from the cage more quickly than farmed cod, taking 5.5 hours for 50% of the wild cod to disperse > 1 km from the cage site, compared with 12.6 h for farmed cod. Farmed cod spent most of their time near the cage, while wild cod spent most of their time at the mouth of the bay at a traditional feeding ground. Following departure from the cage area, farmed and wild cod dispersed mostly northward along the coast, and within 4.5 months post release 55% of wild and 88% of farmed cod had been detected on an acoustic receiver array located 25 km northward of the cage site close to the coastline. The results suggest that escaped farmed cod could only be recaptured near the cage within a day of the escape event. Following the initial escape period, farmed cod showed a similar dispersal pattern to wild cod and could potentially interact with them. The results of our study can be applied to the emerging cod aquaculture industry, as well as that of other marine finfish, to reduce the number of escapes, streamlining the development of the industry before mitigation becomes too difficult and costly to implement.','Fleming, I.A., Zimmerman, E., Purchase, C.F., Brattey, J., Porter, D. 2011. Dispersal of escapee farmed Atlantic cod (Gadus morhua).','Ian A. Fleming','MUN','ifleming@mun.ca','http://members.oceantrack.org/data/discovery/IFC.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-52.8,-52.8,47.31,47.31,0,95.479,'OTN-Global'),('IFS1','OTN Canada Atlantic Salmon Smolt DST Study','The focus of the research was two pronged: (1) on the testing  of tag shape and tagging methodologies for fitting smolts with the miniaturized versions of Data Storage Tags (DSTâ€™s), and (2) ultimately, on the tagging and release of smolts at the Campellton River. This study was initiated in May 2010 and is ongoing. On 14 May 2010, 102 smolts from the Rocky River, Newfoundland, and captured at a smolt trap, were transported to the Ocean Sciences Centre (Memorial University) for testing tag attachment methodologies. An outbreak of a flavobacterium at the end of May lead to 24 mortalities and the need to treat the fish with tetracycline. The remaining fish recovered and were tagged on 6 July: 20 with an internal version of the dummy DST, with a light stalk protruding from the body cavity; 40 with an external version of the dummy DST, 20 attached with a bridle design in the dorsal musculature and 20 with a tether through the dorsal musculature; and 14 fish served as controls, with PIT tags for individual identification. These fish were monitored through November 2010. Our findings indicated that the tether attachment was the most effective methodology; many of the internal tags were expelled over the course of 1.5 mo and bridles caused excessive wear. Further testing, including swim chamber tests, with refined tag shapes and tagging methodologies was commenced November 2010 and ran through to February 2011. A flat, rectangular design of the LAT2900 tag with tether attachment was decided upon. In May 2011, 215 smolts (fork length 21.2 Â± 2.1 cm; total weight 99.1 Â± 28.5 g) were collected, tagged and released at the Campbellton River. Survivors should return in summer 2012.','Evans, M.L. Fleming I.A., Robertson, M.J., Conway, C.M., Downton, P., Reddin, D.G. 2011. Development of a tag and tagging methodologies for study the marine migrations of Atlantic salmon smolts using geo-location archival tags.','Ian A. Fleming','MUN','ifleming@mun.ca','http://members.oceantrack.org/data/discovery/IFS1.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-54.92,-54.92,49.28,49.28,0,95.479,'OTN-Global'),('IFS2','OTN Canada Atlantic Salmon Kelt DST and Acoustic Tag Study','For migratory fishes, temporal variation in the utilization of habitats is likely to occur at broad and fine scales, reflecting both ecological and metabolic factors. We are currently using data loggers designed to record date/time, internal and external temperature, light, and pressure to examine freshwater and marine habitat use in three Atlantic salmon stocks from Newfoundland: the Northeast Brook, Campbellton River, and Western Arm Brook. We will also use functional genomics to investigate the physiological profiles associated with successful returns to freshwater from the marine habitat. The simultaneous examination of behaviour and genomic regions associated with physiology should shed light on the abilities of each of these populations to cope with temperature shifts in the marine environment.','Evans, M.L. Fleming I.A., Robertson, M.J., Conway, C.M., Rise, M. 2012. Linking behaviour and ecological genomics in Newfoundland Atlantic salmon.','Ian A. Fleming','MUN','ifleming@mun.ca','http://members.oceantrack.org/data/discovery/IFS2.htm','DETECTIONS; ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-56.88,-53.36,51.08,46.74,0,95.479,'OTN-Global'),('IWP','IWP fish tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Floros, C. yyyy. iSimangaliso Wetland Park fish tracking','Camilla Floros','ORI','cfloros@ori.org.za','http://members.oceantrack.org/data/discovery/IWP.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',31.015365,32.8653,-27.0469,-29.933734,0,95.479,'OTN-Global'),('JGS','DFO: Sable Island Greenland Sharks','We conducted a study of the Greenland shark at Sable Island, Nova Scotia in an attempt to describe the large-scale movements of the sharks in the waters of the north Atlantic in the vicinity of Sable Island using a combination of 1) pop-up archival transmitting tags (PAT) and 2) coded ultrasonic tags and automated data-logging listening stations.','Klimley, A.P., Campana, S., Joyce, W., Fisk, A. 2008. Movements of Greenland sharks near the seal colony at Sable Island, Canada.','A. Peter Klimley','DFO-BIO','apklimley@ucdavis.edu','http://members.oceantrack.org/data/discovery/JGS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to o