e provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-66.01,-66.01,45.36,45.36,0,95.479,'OTN-Global'),('KNE','NOAA Kennebec Salmon Tracking','NOAA\'s National Marine Fisheries Service (NOAA) has been evaluating emigrating Atlantic salmon (ATS) smolt dynamics and survival via ultrasonic telemetry since 1997 (Kocik et al. 2009). Initial telemetry studies were of native populations in the Narraguagus River and have since expanded to other rivers and varying age classes of both hatchery and naturally-reared smolts. This project is NOAAâ€™s first investigation into naturally-reared ATS smolt dynamics in the Kennebec system. The Kennebec River forms part of the Merrymeeting Bay itself which is comprised of six river systems including the Androscoggin River.  The Merrymeeting Bay type formation, due to its joining of two large river systems, can only be found in three other places on earth (Burroughs 2006). We are focused on better understanding smolt migration dynamics, quantifying migration success and identifying areas of high mortality through estuarine and bay areas within the study array and beyond into coastal waters in collaborations with OTN and other partners. We use this information in support of management activities to reduce threats, evaluate project impacts and work windows, and to improve ATS survival in the near shore marine environment. We are tracking smolts from the lower Kennebec River, through Merrymeeting Bay and lower Kennebec Estuary using an array of ~ 30 receivers deployed and maintained in cooperation with the Maine Department of Marine Resources. Objectives are to evaluate migration timing and behavior, and survival to the Gulf of Maine.','Goulette, G., Hawkes, J. 2014. NOAA Kennebec salmon tracking.','Graham Goulette','NOAA-NMFS-NEFSC','graham.goulette@noaa.gov','http://members.oceantrack.org/data/discovery/KNE.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-69.64,-69.64,44.53,44.53,0,95.479,'OTN-Global'),('KSC','KSC Ecological Program and US NUWC Acoustic Tagging','Estuarine and nearshore waters at Cape Canaveral, Florida, sustain one of the most diverse fish faunas in North America and includes over 150 species that are actively managed at the federal or state level. NASAâ€™s Kennedy Space Center (KSC) plays a significant and positive role in regional wildlife management issues because it contains or borders some of the best remaining coastal habitat left in east Florida, and encompasses the oldest marine reserve in the United States. The KSC Ecological Program is using both passive acoustic telemetry and traditional fisheries techniques to resolve questions concerning the abundance, site fidelity, spawning locations, and coastal migrations of our region\'s most economically and ecologically important sportfish and shark species. We also monitor the movements of sea turtles who use waters at Cape Canaveral as a developmental habitat. Besides advancing basic knowledge of fish and turtle life history, our findings help understand the consequences of natural and human disturbance events (e.g., algae blooms, cold snaps, dredging, shoreline development), and have been used for Essential Fish Habitat (EFH) consultations, revising of EFH maps, and updating federal and state stock assessments.','Reyier, E., Provancha, J., Ahr, B, Scheidt, D, Holloway-Adkins, K. 2017. Life History Studies of Sportfish, Sharks, and Sea Turtles in Estuarine and Nearshore Waters at Cape Canaveral, Florida, USA','Bonnie Ahr','NASA-BOEM','bonnie.j.ahr@nasa.gov','http://members.oceantrack.org/data/discovery/KSC.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-81.48,-80.42,30.71,28.1,0,95.479,'OTN-Global'),('KZNSB','KZNSB fish tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes det