commercially important species for the Bay of Fundy, Canada. There are knowledge gaps about the movement of American lobsters and how they may be impacted by the tidal turbine developments in the region. In November and December, 2017, 50 American Lobster were acoustically tagged in the Inner Bay of Fundy, Minas Passage and Minas Basin. The lobster were captured by benthic traps deployed during typical lobster fishing operations. Acoustic receivers deployed by various parties will be used to track the movements of the animals. This project aims to define the movement patterns of this species while integrating local, traditional and academic knowledge.',' 2017. Movement patterns of American lobsters in the Minas Basin, Minas Passage, and Bay of Fundy, Canada.','Mike Dadswell','OTN','mike.dadswell@acadiau.ca','http://members.oceantrack.org/data/discovery/MFAL.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-64.221552,-64.221452,45.2010074,45.2009074,0,95.479,'OTN-Global'),('MMFSTS','MMF Sand Tiger Sharks','The Massachusetts Shark Research Program and Anderson Cabot Center for Ocean Life at the New England Aquarium are partnering to examine the ecology, distribution, and relative abundance of sharks subjected to fisheries off the east coast of the US. One of the primary goals of this collaboration is to study the broad and fine-scale movements of sharks using acoustic tags. Tagging of juvenile sand tiger sharks began in 2008 after increased reports of landings by local fishermen and resulted in the identification of important nursery habitat in Plymouth, Kingston, Duxbury Bay. The project has recently expanded to Boston Harbor and Nantucket Sound, which may also serve as nursery areas.','Skomal, G., Kneebone, J., Chisholm, J. 2008. Massachusetts Marine Fisheries Sand Tiger Sharks.','Greg Skomal','MMF','gregory.skomal@state.ma.us','http://www.andersoncabotcenterforoceanlife.org/blog/local-sharks-studying-sand-tiger-sharks/','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-71.52,-70.66,41.99,41.37,0,95.479,'OTN-Global'),('MRMR','Mozambique reef manta ray','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Marshall, A. yyyy. Mozambique reef manta ray tracking. ','UNKNOWN','MMF','UNKNOWN','http://members.oceantrack.org/data/discovery/MRMR.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',35.364267,35.364267,-23.856172,-23.856172,0,95.479,'OTN-Global'),('MSA','Margaree Salmon Association','Atlantic salmon from different rivers show great diversity in their life history patterns, which are linked to their migratory pathways. The Margaree River is one of the primary Atlantic salmon rivers in the Province of Nova Scotia, and unlike many of the other NS rivers that exit to the Atlantic Ocean, drains to the Gulf of St. Lawrence. To document the migratory patterns of fish from this river, Atlantic salmon smolts and kelts from the Margaree River population were tagged and released in 2010 and 2011. Salmon were to be detected either by the OTN Cabot Strait array which covers the southern exist of the Gulf, or a partner array maintained by the Atlantic Salmon Federation in the Strait of Belle Isle that enters the Atlantic on the northern fringe of the Gulf. ','','Fred Whoriskey','MSA','fwhoriskey@dal.ca','http://www.margareesalmon.com/','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-61.09,-60.97,46.37,46.34,0,95.479,'OTN-Global'),('NARR','Characterizing the behavior and survival of age 1 hatchery stocked smolts in the Narraguagus River, Maine U.S.A.','NOAA\'s National Marine Fisheries Service (NOAA) has been evaluating emigrating Atlantic salmon (ATS) smolt dynamics and survival via acoustic telemetry  within the Narraguagus River since 1997. Optimizing the number of smolts that enter the ocean from coastal rivers and into the Gulf of Maine is a management priority.  Until recently, the Narraguagus River has been solely supported by natural reproduction and fry stocking within the watershed. In 2008, a five year smolt stocking effort was implemented with intentions of boosting adult returns.  Approximately 40,000 smolts were stocked annually over this five year period with limited success. 154 2SW adult returns were documented, which is 5.6 2SW adults per 10,000 smolts stocked. These results are much lower than the natural component (63.2/10,000) of the Narraguagus and returns from age 1 hatchery smolt stocking on other nearby systems during the same timeframe. Through this effort we will investigate and describe the behavior and success of conservation hatchery smolt with differing release times migrating through the river, estuary, and nearshore environment to determine if there are differences between groups.  In addition to migration performance, we will identify bottlenecks (predation, environment, habitat, etc) which will inform managers of areas of focus during restoration efforts within the watershed to optimize the number of post smolts entering the Gulf of Maine.','Hawkes, J.P., Goulette, G.S. 2017. Characterizing the behavior and survival of age 1 hatchery stocked smolts in the Narraguagus River, Maine U.S.A.','James Hawkes','NOAA','james.hawkes@noaa.gov','http://members.oceantrack.org/data/discovery/NARR.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-68.1,-67.8,44.7,44.5,0,95.479,'OTN-Global'),('OCRSA','OCEARCH shark tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Johnson, R., Kock, A., Meyer, M. yyyy. OCEARCH Ocean Research shark tracking.','Ryan Johnson','OCEARCH','rj@ryan-johnson.org','http://www.ocearch.org','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',18.585,25.66,-33.96,-34.695,0,95.479,'OTN-Global'),('ORI','ORI','Initial hypotheses suggest that because catches of giant guitarfish (Rhynchobatus djiddensis) are very seasonal (mainly caught in summer) and display nomadic movement behaviour, individuals from the population are moving into warmer Mozambican waters during winter where they are being heavily targeted by artisanal fisheries operating inshore and foreign vessels offshore (mainly for the shark fin trade). The overall aim of this project is to better understand the movement patterns and connectivity of R. djiddensis along the KZN coast and Southern Mozambique using an existing array of VR2 listening stations. This will augment the conventional tag data collected by the ORI-CFTP and fill in the knowledge gaps where possible.','Mann, B., Cowley, P. 2016. Transboundary movements of giant guitarfish (Rhynchobatus djiddensis)','Bruce Mann','ORI','bruce@ori.org.za','http://www.seaworld.org.za/ori','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',30.849909,31.169909,-29.701825,-30.021825,0,95.479,'SAF'),('PBU','USGS: Salmon tagging','The proposed plan to remove the Veazie and Great Works dams on the Penobscot River (as part of the Penobscot River Restoration) offers an unusual opportunity to examine the ecological and environmental changes surrounding a major river restoration in New England. Considerable runs of anadromous fish (e.g., American shad, alewife, sea lamprey and Atlantic salmon) occurred in the Penobscot River prior to the construction of main-stem dams in the early 1800\'s. Migratory fish populations declined precipitously after dams were installed. With the planned removal of two main-stem dams on the Penobscot River beginning 2012, there is great optimism that reestablishment of passage will lead to restoration of the ecosystem. This restoration would include improved migration and passage of migrating fish. Though these anticipated changes are a major impetus for the restoration activities, the scope of recovery for migratory species will necessarily depend on the degree to which connectivity is realized. Fish passage at the remaining dams, both upstream and downstream, is necessary for the completion of the life histories of many fishes. This proposed work is aimed at characterizing current and future passage conditions of Atlantic salmon and other migratory fishes.','Zydlewski, J. 2005. Assessment of Atlantic salmon migratory success in the Penobscot River, Maine.','Joseph Zydlewski','USGS','josephz@maine.edu','http://www.wle.umaine.edu/faculty/Zydlewski/zydlewski.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-69.54,-68.23,45.64,44.18,0,95.479,'OTN-Global'),('PIUI','Spatio-temporal habitat partitioning between lionfish species on coral reefs','Habitat partitioning is a well-known strategy to reduce competition among species that consume similar resources. Species might separate their habitat spatially, temporally or both.  While numerous example for such habitat partitioning are know from land, until recent years fine-grained habitat utilization data in the ocean has been difficult to collect preventing the identification of such patterns. In the Gulf of Aqaba two species of lionfish co-exist\\; Pterois miles and Pterois radiata. These species are common predators on the coral reef. Moreover, Pterois miles is invasive in the Caribbean and the Mediterranean and may have adverse impacts on indigenous fish communities. Since these species have similar diets and are morphologically similar it is unclear how they manage to co-exist within a single habitat. In this research, we use acoustic telemetry technology in order to estimate each species space-use patterns, activity times and depth range. This will be used to assess whether spatial or temporal habitat partitioning occurs between these species. This information will also be used to understand lionfish behavior in its native range which can then be compared to its behavior in the invaded range.','Belmaker,Y., Pickholtz,R., Kiflawi,M., Gavriely,T. 2017. Spatio-temporal habitat partitioning between lionfish species on coral reefs.','Tal Gavriely','TAU','talgav@gmail.com','http://members.oceantrack.org/data/discovery/PIUI.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',34.8,35.01,29.6,29.4,0,95.479,'OTN-Global'),('PLT','WA Fisheries: Tailor tag releases','This project will develop approaches to determine the age structure and stock status of key inshore species (Australian herring, tailor, whiting) using a weight of evidence approach. In addition, modern techniques to determine the connectivity of West Coast and South Coast stocks will also be undertaken to define source and sink of recruits (i.e. the link between juveniles and adults) in order to explore the development of predictive forecasting of relative abundance.','Lewis, P. 2010. West Coast nearshore finfish status and connectivity.','Paul Lewis','WA Fish','paul.lewis@fish.wa.gov.au','http://members.oceantrack.org/data/discovery/PLT.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',115.66,115.67,-32.09,-32.09,0,95.479,'OTN-Global'),('POZS','Ponta do Ouro zambezi shark tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Daly, R. yyyy. Ponta do Ouro zambezi shark tracking.','Ryan Daly','Rhodes U','ryandaly.mail@gmail.com','http://members.oceantrack.org/data/discovery/POZS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',32.9,32.9,-26.84,-26.84,0,95.479,'OTN-Global'),('PRT','OTN Perth Line','The concept for the line that was originally called West Cape Howe and was to capture physical oceanographic data to improve the Ocean model BRAN, is now called the Perth Line. In this system, ocean currents sweep southward from waters around Indonesia. Multiple species of commercially valuable animals interact with this ocean current. BRAN is currently the most sophisticated ocean model in the world, and it is built solely on remote sensing (satellite) data. Measurements from below the ocean\'s surface will greatly increase the accuracy of the model. OTN receivers will provide the biological part of an ocean observation system that will collect sub surface data from measurement of physical and biological variables using moored sensors and tagged animals. This line was moved slightly north from its original proposed position as the Perth area is more accessible, and recent tracking has proven that the Perth area is a hotspot for multi-species animal migrations. Whale sharks are one species of interest in the system. They draw in many tourists and therefore are very economically valuable to the economy of this area. Other animals that will also be tagged in the vicinity will include Great White sharks and valuable tuna species. AATAMS has many on-going research studies in nearby Nigaloo reef. There will be much valuable information gained on the migrations of these animals as they cross the Perth Line. ','Semmens, J., McAuley, R., O\'Dor, R., Stokesbury, M., Branton, R. 2009. Ocean Tracking Network Perth Australia Line Metadata and Data Set.','Jayson Semmens','WA Fish','jayson.semmens@utas.edu.au','','ACOUSTIC RECEIVERS; DETECTIONS; ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',107,115.73,-32.2534,-29.94937,0,7,'OTN-Global'),('QIK','Habitat connectivity of Greenland halibut and Greenland sharks throughout Baffin Bay','The Northern coast of Baffin Island is characterized by fjords and deep-water troughs created by glacial retreat that are now habitats for diverse deep-water species in the coastal area. There is interest in many Inuit communities along this coast to develop fisheries that target deep-water species such as the Greenland halibut which can bring much needed economic development to the area, however there already exists a relativly extensive offshore commercial fishery that targets this same species. Acoustic tracking work in Scott Inlet has determined that Greenland halibut often move between the coastal and offshore areas of Baffin Bay, yet the extent of thier movement in the offshore, and the connectivity between coastal fjords/troughs remains unknown. The addition of acoustic monitoring in the coastal trough and offshore area of Qikiqtarjuaq has been added to the Arctic monitoring program to compliment the work continuing in Scott Inlet to determine the level of connectivity between these coastal habitats as well as the offshore. In the interest of sustainable fisheries development, this project looks at stock connectivity of Greenland halibut as well as ecosystem interactions with other by-catch species, predominantly the Greenland shark and Arctic skate.','Hussey, NE. 2015. Habitat connectivity of Greenland halibut and Greenland sharks throughout Baffin Bay','Nigel Hussey','U Windsor','nehussey@uwindsor.ca','http://members.oceantrack.org/data/discovery/QIK.htm','ACOUSTIC RECEIVERS; DETECTIONS; ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-68,-58,67.4653,68.06873333,0,200,'OTN-Global'),('QMS','Quebec MDDEFP Atlantic Sturgeon Tagging','The specific objectives of this project are: (a) to describe movements and habitat selection of adult Atlantic sturgeon and (b) to identify spawning habitats.','Verreault, G., Dussureault, J. 2013. Movement patterns, habitat use, and spawning habitats of adult Atlantic sturgeon (Acipenser oxyrinchus) of the St. Lawrence River and estuary, Quebec, Canada','Guy Verreault','GdQ','guy.verreault@mffp.gouv.qc.ca','http://members.oceantrack.org/data/discovery/QMS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-70.42,-70.11,47.39,47.2,0,95.479,'OTN-Global'),('RNP','NTNU River Nidelva Project','The purpose of the River Nidelva project is to monitor the migration of anadromous brown trout between river and fjord. Hatchery-reared sea trout are tracked in order to monitor their willingness to migrate to the ocean. Adult sea trout of wild origin are tagged and tracked for 14 months in order to map their movements between freshwater and saline habitats.','Davidsen, J.G., Arnekleiv, J.V., Koksvik, J.I. 2012. Migration of anadromous brown trout between river and fjord, Nidelva, Norway.','Jan Grimsrud Davidsen','NTNU','jan.davidsen@ntnu.no','http://members.oceantrack.org/data/discovery/RNP.htm','ACOUSTIC RECEIVERS; DETECTIONS; ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',10.3391,10.44,63.3832,63.45153,0,2,'OTN-Global'),('SABMPA','St. Anns Bank Species Tracking Study','The St. Anns Bank Marine Protected Area was established in June 2017. In support of the long-term management of this MPA, an ecosystem monitoring program is currently being designed to evaluate performance relative to conservation objectives. Data describing the spatial-temporal patterns of species movement relative to MPA boundaries is essential for evaluating species composition and to gauge the protective capacity of the MPA.  In 2015, a snow crab movement monitoring project was established in the St. Anns Bank area, with collaboration between industry, the OTN and DFO.  Acoustic receiver arrays deployed as part of this project  can provide an opportunity to record the presence of tagged species who reside in, or transit through, the MPA. In particular, acoustic monitoring of tagged focal species (Atlantic cod (Gadus morhua) and Atlantic striped wolfish (Anarhichas lupus)) inside the MPA and beyond the receiver array, will provide important information for performance evaluation and design.','Stanley, R; Zisserson, B and Fenton, D. 2016. St Anns Bank Species Tracking Study. ','Ryan Stanley','DFO-BIO','ryan.stanley@dfo-mpo.gc.ca','http://members.oceantrack.org/data/discovery/SABMPA.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-59.65,-58.25,46.3,45.75,0,95.479,'OTN-Global'),('SAIAB','SAIAB fish tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Cowley, P., Childs, A., Murray, T., Bennett, R. yyyy. South African Institute for Aquatic Biodiversity fish tracking.','Paul Cowley','SAIAB','tagfish@gmail.com','http://www.saiab.ac.za/','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',18.453813,32.94051,-26.7436,-34.40943,0,95.479,'OTN-Global'),('SASC','SASC','Due to its low biological productivity (reproductive periodicity of three years) and longevity (>60 years), combined with inadequate fishery management measures, G. galeus has experienced significant global population declines. Owing to its largely coastal nature, G. galeus is additionally threatened by coastal climate change, critical habitat degradation and other anthropogenic impacts. Few management measures exist to protect the species within South African waters. As a result, this study aims to 1) examine habitat use patterns and determine which areas of the South African coast are utilized by Galeorhinus galeus; 2) describe spatial and temporal movement behaviour of juvenile and adult G. galeus; and 3) inform an assessment of area management measures to conserve the species on a national scale.','McCord, M. 2017. Movement ecology of soupfin shark (Galeorhinus galeus) along the southern coast of South Africa','Meaghan McCord','SASC','meag@sharkconservancy.org','http://www.sharkconservancy.org/','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',19.1961111,19.2761111,-34.3775,-34.4575,0,95.479,'SAF'),('SBT','CSIRO: SBT tagging','Over 100 juvenile southern bluefin tuna (SBT) will be tagged in coastal waters of Western Australia to: (1) Determine the west-to-south movement rate of age-1 SBT into the southern coast of Western Australia (WA), where a Recruitment Monitoring Survey has been conducted since 1995 to estimate the relative abundance of age-1 SBT, and (2) Determine the oceanographic factors influencing the interannual fluctuation of the movement rate from the west coast to the southwest coast, needed to estimate the proportion of the juvenile stock that is in southern Australia during the austral summer.','Hobday, A. 2009. Australian CSIRO Southern Bluefin Tuna Tag Releases.','Alistair Hobday','WA Fish-CSIRO','alistair.hobday@csiro.au','http://members.oceantrack.org/data/discovery/SBT.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',114.84,117.78,-32.06,-35.18,0,95.479,'OTN-Global'),('SPI','Shippagan, NB: Cod tagging','The objectives of this project are first to study the seasonal migration of the Atlantic cod (Gadus morhua) in the southern Gulf of St. Lawrence and secondly to examine possible interaction between cod and grey seal (Halichoerus grypus). Cod were caught and tagged at Miscou Bank in the spring and lines of receivers were installed off Northwestern Cape Breton to intercept cod migrating out of the Gulf in the fall and back into the Gulf in the spring.','Swain, D., Comeau, L., Bowen, W.D. 2009. Seasonal Migration of Southern Gulf of St. Lawrence Cod.','Doug Swain','DFO-GFC','doug.swain@dfo-mpo.gc.ca','http://members.oceantrack.org/data/discovery/SPI.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-64.83,-63.55,48.36,47.54,0,95.479,'OTN-Global'),('SSST','Shark Spotters shark tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Kock, A., Barnett, A. yyyy. Shark Spotters shark tracking.','Alison Kock','Shark Spotters','alison.kock@gmail.com','http://sharkspotters.org.za/','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',18.518072,18.518072,-34.349615,-34.349615,0,95.479,'OTN-Global'),('SSTDEL','Atlantic Sturgeon and Sand Tiger Acoustic Detections Matched to Oceanographic Conditions in the Mid-Atlantic','Species locations obtained from acoustic telemetry are rarely related to the dynamic ocean conditions the marine animals were experiencing at receiver locations. Satellite-measured sea surface conditions from the MODIS-Aqua platform provide measurements of oceanographic conditions on time (daily) and space (1 km2) scales relevant to acoustic telemetry studies. Here we provide a dataset of matched species occurrence data, along with the concurrent static (bathymetry) and dynamic (remotely sensed sea surface conditions) environmental variables, for approximately 5 years (2009-2014) of acoustic telemetry data in the Delaware Bay and nearby coastal ocean. Our dataset focuses on two species of interest, the Sand Tiger (Carcharias taurus) and the Atlantic Sturgeon (Acipenser oxyrhynchus oxyrhynchus).','Breece, M.W., Haulsee, D.E., Oliver, M.J., Fox, D.A. 2018. Atlantic Sturgeon and Sand Tiger Acoustic Detections Matched to Oceanographic Conditions.','Danielle Haulsee','UDEL','dhaulsee@udel.edu','http://members.oceantrack.org/data/discovery/SSTDEL.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-75.06873978,-75.06604182,39.4467338,38.38686032,0,95.479,'OTN-Global'),('TAG','Tag-A-Giant','The northern bluefin tuna that migrate across the Atlantic and Pacific oceans are disappearing, due to high demand for sushi. Building on the Stanford UniversityÃ­s Tag-a-Giant a research program which began in 1994, the Tag-A-Giant (TAG) organization was founded in 2006 by a dedicated group of scientists and recreational fishermen to support scientific research, policy and conservation initiatives that promote a sustainable future for bluefin tuna. Tag-A-Giant is committed to reversing the decline of northern bluefin tuna populations by supporting the scientific research necessary to develop innovative and effective policy and conservation initiatives. TAG scientists have electronically tagged nearly 1,800 northern bluefin tuna in the Atlantic and Pacific Ocean basins to document the speciesÃ­ movements, habitat use, inter-year fidelity to feeding and breeding sites, and to estimate natural mortality rates. Tracking work has been combined with other new technologies including genetic analyses to develop new insights into the species ecology, physiology and behavior.   For more information see http://tagagiant.org/','Not available','Barbara Block','Stanford U','bblock@stanford.edu','http://tagagiant.org','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-75.13,-61.36,46.34,35.02,0,95.479,'OTN-Global'),('TOA','Raggedtooth shark (Carcharias taurus) tracking by the Two Oceans Aquarium','Two Oceans Aquarium has tagged over 30 raggedtooth sharks (Carcharias taurus) and are their movement behaviour is currently being tracked by ATAP receivers along the South African coastline.','Beukes, T. 2010. Raggedtooth shark (Carcharias taurus) tracking by the Two Oceans Aquarium','Tinus Beukes','TOA','tinus.beukes@aquarium.co.za','https://www.aquarium.co.za/','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',16,34,-26,-35,0,95.479,'SAF'),('TZWS','Thresher, zambezi, and white shark tracking','South Africa\'s Institute for Aquatic Biodiversity (SAIAB), located on the campus of Rhodes University in Grahamstown, South Africa, maintains the Acoustic Tracking Array Platform (ATAP). OTN supports ATAP through equipment loans, and by working with ATAP data managers to build a telemetry data node for use by African scientists. This South African node is leveraging OTN\'s data toolset and templates and integrating with the OTN and its partners\' data systems to help build a global tracking base. Collaboration between researchers is essential for understanding large-scale movement patterns of ecologically important species.  ATAP\'s arrays and data systems includes detections from equipment owned by itself, on loan from the OTN, or placed and maintained by independent partners who share data through the ATAP data node. The ATAP network provides comprehensive coastal and estuarine coverage across South Africa\'s coastline and north into the waters of Angola and Mozambique on Africa\'s west and east coasts, respectively. These arrays are providing scientists in the region with an unprecedented opportunity to study the movements of top predators such as white sharks as well as other migratory coastal and estuarine species. Additional details about individual tracking projects which are a part of ATAP are available by contacting the associated researcher.','Dicken, M. yyyy. Thresher, zambezi, and white shark tracking.','Matt Dicken','NMMU','raggedtoothshark@bayâ€‹world.co.za','http://members.oceantrack.org/data/discovery/TZWS.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',25.801,32.9,-26.84,-33.83425,0,95.479,'OTN-Global'),('V2LAND','Tracking the critically endangered smalltooth sawfish','Animal movement influences the distribution and abundance of organisms, as well as ecological processes operating at the population, community, and ecosystem level. A thorough understanding of movement patterns of a species is critical for designing effective conservation and management initiatives. However, incorporation of movement data into conservation strategies remains underutilized and a common challenge for researchers, as there is often a lack of knowledge of where, when, and why a species moves. Here we use acoustic telemetry to improve our understanding of the movement ecology of one of the worlds most imperiled marine vertebrate, the smalltooth sawfish (Pristis pectinata). We aim to examine a number of questions including identifying to what extent East Andros is used by the sawfish, temporal patterns of habitat use in the region and exploring if East Andros is a migratory corridor for smalltooth sawfish, with transient use or if animals in this region display philopatry (i.e. residency or site fidelity) to particular areas? Determining the connectivity of smalltooth sawfish populations (e.g. within and between the Bahamas and USA) is critical to their recovery.','Guttridge, TL., Bond, ME., Carlson J., Kroetze A., Grubbs DR. 2018','Andrea Kroetze','SHG','andrea.kroetz@noaa.gov','http://members.oceantrack.org/data/discovery/V2LAND.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-77.72258238,-77.71988442,24.48705248,24.48435452,0,95.479,'OTN-Global'),('V2LCASP','Canaries Angel Shark Project','Angel sharks (Squatina squatina) are one of the most endangered fish in European waters and are currently listed as Critically Endangered on the IUCN Red List. The Canary Islands have been identified as a unique stronghold for S. squatina, where they are regularly sighted by divers and fishers. However, here too they are under significant threat from incidental catch in poorly-managed commercial and recreational fisheries, habitat degradation from pollution, coastal development and marine infrastructure and disturbance by divers and beach users. Over the last three years, the Angel Shark Project has become the established authority for angel shark conservation and research in Europe. This has been established through gathering critical information on angel shark distribution via our network of partners including sport fishers, dive operators and local NGOs. The proposed project therefore builds on this distribution data to address key questions about residency and space use of S. squatina. The lack of knowledge around the timing and distances of movements in this species is hampering current efforts to establish and implement protection throughout the area. As such, the data from a deployment of year-round acoustic receivers will directly inform the Spanish Governmentâ€™s proposed management strategies for The Canaries. In addition to movement data, this collaborative project funded by the National Geographic and Lisbon aquarium, is developing a bespoke tagging and attachment methodology to enable the external tagging of angel sharks in situ as they rest on the substrate, avoiding capture and stress of individuals. This open source methodology will likely facilitate the attachment of tags to other benthic species where capture of individuals is problematic or politically sensitive. To our knowledge, this will be the first deployment of long-term tracking equipment for S. squatina providing essential data that will act as a baseline for future actions attempting to conserve this species.','Barker, J., Alvarado, D., Meyers, E., Jacoby, D. 2018. Canaries Angel Shark Project - Tracking the spatial ecology of angel sharks in their last remaining stronghold','David Jacoby','ZSL','david.jacoby@ioz.ac.uk','https://angelsharkproject.com/','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-13.8820607,-13.41929,29.2405854,28.8386194,0,95.479,'OTN-Global'),('V2LFALK','Brown trout in the Falkland Islands','Brown trout (Salmo trutta) were introduced to the Falkland Islands on several occasions during the 1940Ã­s and 1950Ã­s, mostly for recreational fishing. Since, there has been a marked decline in the native freshwater fish fauna, which consists of only three species of galaxiid fishes, endemic to the Southern Hemisphere (zebra trout Aplochiton zebra, Aplochiton taeniatus, and the Falklands minnow Galaxias maculatus; Vanhaecke et al. 2012). Given the threats to the long-term conservation of the native galaxiids, detailed knowledge about the life history, movement ecology of brown trout and their overlap and interactions with the native species is urgently needed. However, at present virtually nothing is known about the extent and seasonality of brown trout movements in the Falkland Islands, or how these can impact on native galaxiids. Two presence/absence surveys, conducted 10 and 20 years ago respectively, provided valuable synoptic snapshots of the distribution of brown trout and galaxiids in the Falklands. McDowall et al. (2001) used electrofishing to survey the islands in 1999 and showed that brown trout had invaded most rivers with the exception of those in the southwest region of West Falkland (Lafonia). Elsewhere, brown trout showed a high degree of spatial segregation with zebra trout in particular, which may indicate competitive displacement and/or predation of zebra trout by brown trout, and may thus explain the decline of Aplochiton sp. since the 1950s. At the time of the survey, most zebra trout were concentrated within small refuge areas uninvaded by brown trout. However, the tendency of brown trout to display anadromy in the Falklands, makes it likely that they could eventually colonize all the accessible rivers. The risk of native galaxiid extinction is therefore high. With this in mind, our study aims to answer two main questions about the movement ecology of brown trout in the Falklands: (1) what is the current distribution, abundance and population structure of brown trout? and (2) what are the impacts of brown trout on native galaxiids? These questions will be answered by employing a variety of techniques including environmental DNA to non-destructively assess the distribution and abundance of brown trout and native galaxiids in various watershed, in conjunction with electrofishing, which will allow us to estimate population (or river stock) abundance as well as assess the health and reproductive status of individuals and stocks. Electrofishing will also provide us with an opportunity to capture individual brown trout for acoustic tagging from different watersheds, thus allowing us to meet our first aim by tracking individual movements and dispersal patterns, among watersheds and between East and West Falklands. We will also take fin samples from individuals for genotyping, thus obtaining data on the genetic diversity and gene flow between watersheds of brown trout and native species. Stable isotope analysis will also be conducted on fin samples from brown trout and native galaxiids to determine the levels of trophic overlap and predation between species.','Minett, J., Garcia de Leaniz, C., Consuegra, S., Crossin, G., Brickle, P. 2018.Brown trout in the Falkland Islands: invasion ecology, population structure and genetic diversity.','Jessica Minett','Swansea U','787346@swansea.ac.uk','http://members.oceantrack.org/data/discovery/V2LFALK.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-61.3792419,-57.6768495,-50.9809115,-52.4744161,0,95.479,'OTN-Global'),('V2LMOZ','Mitigating the risk of shark attack by investigating the movement and residency patterns of  bull sharks','Twelve fatal bull shark (Carcharhinus leucas) attacks have occurred in the Inhambane estuary in the last two years. In response, a shark cull was implemented in 2016. The effects of this, in combination with overexploitation in other fisheries raises concerns on the future sustainability of sharks in this region. This project aims to investigate the residency, habitat use and movement patterns of sharks in the estuarine system to prevent further shark attacks. The project has been developed at the bequest of the Inhambane Fisheries Department to formulate fishing policies, which will mitigate the chance of shark attack in an environmentally sustainable manner.','Murie, C., Dicken, M., Oliver, S. (2017) Mitigating the risk of shark attack by investigating the movement and residency patterns of  bull sharks (Carcharhinus leucas) in a Mozambican estuary.','Calum Murie','MMF','calummurie@gmail.com','http://members.oceantrack.org/data/discovery/V2LMOZ.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',34.5,36,-23.5,-24.5,0,95.479,'SAF'),('V2LMZBS','Bazaruto Archipelago National Park Bull Shark Connectivity','Bull sharks (Carcharhinus leucas) are responsible for at least 12 human attacks over the last three years in the Inhambane province of Mozambique. Little is known of their movements, habitat use, or population connectivity in the region. Since the species is subjected to targeted fishing, and is afforded no legislative protection, overexploitation could threaten the population(s). The proposed study aims to track the fine scale movements, habitat use and residency patterns of bull sharks, Carcharhinus leucas, in the Bazaruto Archipelago National Park (B.A.N.P.), and the connectivity of this shark aggregation with other known aggregations in southern Mozambique. Catch per unit of effort will  be used to examine the relative abundance of sharks inside the B.A.N.P., in its neighbouring waters, and 210 km south off of Tofo, Inhambane.','Murie, C., Dicken, D. 2018. Investigating bull shark, Carcharhinus leucas, habitat use and patterns of residency in the Bazaruto Archipelago National Park, and establishing the regional connectivity of bull shark aggregation sites in southern Mozambique','Calum Murie','UWA','calum@underwaterafrica.com','http://members.oceantrack.org/data/discovery/V2LMZBS.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',35.3775429,35.4259301,-23.8608789,-23.9394282,0,95.479,'OTN-Global'),('V2LTAMS','Effectiveness of a no-take zone','The establishment of no take zones has been recognized as an eficiente strategy to increase abundance and biomass of marine organisms of fisheries importance. In TamandarÃ©, South of Pernambuco state, a no take area was established in 1999, by Federal decree, and later included inside the boundaries of a Municipal Marine Park.  The area is part of  the Coral Coast MPA, the largest federal marine protected area in Brazil, with 135 ??. In 2013 the establishment of no-take zones was incorporated in the management plan and replicated along the coast within its boundaries. The expected benefits are not only recovery of marine life inside the area but also benefits to the outside areas through spillover of adults and propagules. Although higher number and biomass of species has been observed inside its boundaries, the benefit for adjacent areas through spill over of individuals needs to be verified.  To fulfil this need, a study of fish movement was designed and implemented in 2014. The aim is to evaluate reef fish habitat use and movement patterns, spill over effect and thus to determine no-take zone effectiveness. The TamandarÃ© array initially consisted of 10 VR2W receivers in the no take area and was expanded to an 18 receivers array in December 2016, covering both the no take area and its surroundings (through a collaboration with Texas A&M University). Areas with distinct reef morphologies (shallow and deep patch reefs, deep submerged reefs, back reef and front reef areas) and physical conditions (wave action, current and tidal effects) are being monitored and the array covers depths from about 1m to 15m. So far, 28 gray parrotfishes (Sparisoma axillare) and 11 Brazilian snappers (Lutjanus alexandrei) have been captured inside the NTZ and tagged with V9 and V8 VEMCO transmitters. Other species with different life strategies will be tagged in the future so to investigate the spatial needs of no-take zones for different objectives.','Ferreira, B.P., Lippi, D.L., Coxey, M.S., Rezende, S.M., Maida, M. 2016. Effectiveness of a no-take zone: habitat use and long-term spillover monitoring of reef fish species, TamandarÃ©, Brazil ','Beatrice Ferreira','UFPE','beatricepadovaniferreira@gmail.com','http://members.oceantrack.org/data/discovery/V2LTAMS.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-35.3415921,-35.0788885,-8.6918747,-8.8014137,0,95.479,'OTN-Global'),('V2LWNERR','Movement ecology of invasive green crabs in a National Estuarine Research Reserve','This project aims to understand the movement ecology of the invasive green crab (Carcinus maenas) in a small Maine estuary (Webhannet River estuary located in the Wells National Estuarine Research Reserve). In particular, we aim to understand sex- and size-specific differences in habitats used and broader-scale movements in and out of the estuary. Preliminary data suggest females may move towards tidal inlets or coastal waters, movements associated with egg release in other crustaceans. Green crabs are invasive along the North American seaboard, and have established large populations throughout the Gulf of Maine. Even with being ubiquitous in the region, little is known about green crab movements or habitat use, information that could be helpful in understanding or minimizing their spread (particularly those of large mature females). Thus, our project will directly contribute to OTNâ€™s mission to provide knowledge on movements and habitat use in order to inform sustainable management. The Webhannet estuary in the Wells National Estuarine Research Reserve (WNERR) is an ideal model system for quantifying green crab movements and habitat use. The estuary is small (~1.5 km-long by ~0.5 km-wide) and shallow, allowing a small telemetry array of < 10 receivers to cover the majority of the system, including all major tidal inlets and outlets. This system is also conducive to supplemental (and regular) manual tracking to locate tags throughout the system. In addition, geospatial data on habitats and bathymetry are available via the WNERR, along with a variety of environmental sensor data (e.g., YSI sondes and NOAA tide-gauge). Thus, we are hoping to directly link movements to variability in habitat (either physical or physiochemical).','Goldstein, J., Ryan, A., Furey, N. 2018. Movement ecology of invasive green crabs in a National Estuarine Research Reserve','Nathan Furey','UNH','nathan.furey@unh.edu','http://members.oceantrack.org/data/discovery/V2LWNERR.htm','; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-70.55427258,-70.55157462,43.34070608,43.33800812,0,95.479,'OTN-Global'),('WDG','Bay of Fundy: Spiny Dogfish','To determine if mature female dogfish remain in Canadian waters or if they cross over the US/Canadian border to American waters. The results would have an effect on the joint management of the dogfish fishery between Canada and the US and help determine the contribution spawning females have to the NW Atlantic metapopulation of dogfish. The data would help with future management of the fishery as well as future discussions with the US.','Campana, S., Joyce, W. 2009. Migration of spiny dogfish.','Steve Campana','DFO-BIO','steven.campana@dfo-mpo.gc.ca','http://www.marinebiodiversity.ca/shark/english/index.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',-66.38,-64.61,45.32,43.64,0,95.479,'OTN-Global'),('WST','WAF Shark Tracking','Information on broad-scale movements of shark populations is used to assess the status of commercially-harvested stocks and improve community understanding of the risks of encountering potentially dangerous sharks around the Western Australian (WA) coastline. The mobility of the four most commercially important shark species have been studied using internally-implanted V-16 family transmitters and a network of cross-shelf acoustic receiver arrays spanning over 2,000 km of WA coastline. Additional detection data have been collected by partner organisations\' acoustic receivers in other parts of Australia. Bronze whaler (Carcharhinus brachyurus), dusky (Carcharhinus obscurus) and white sharks (Carcharodon carcharias) have shown the greatest mobility, with cumulative individual movements of 11,180 km, 10,100 km and 6,990 km, respectively and have (so far) been monitored for periods of up to 1,735, 1,632 and 1,040 days, respectively. Individual tiger (Galeocerdo cuvier), sandbar (Carcharhinus plumbeus) and gummy sharks (Mustelus antarcticus) have also shown repeated long-distance movements between receiver arrays but these were observed less frequently and over smaller geographic ranges than other species. Although conventional tagging previously showed that whiskery sharks (Furgaleus macki) are capable of long-distance inter-jurisdictional movements, acoustic telemetry data suggest that this commercially-significant species\' movements are a less important issue for assessment and management than for other species. Acoustic tag detection data indicate that while potentially dangerous sharks may be present off the South and lower West coasts of WA throughout the year, white and bronze whaler sharks are more likely to be encountered during spring and early summer and are least likely to be present during late summer and autumn, while tiger sharks are most likely to be encountered through summer and autumn. This has important implications for the allocation of public safety resources and for individual\'s understanding of their exposure to shark encounter risks. The study has also enabled a re-evaluation of the risks of cryptic sources of dusky and sandbar shark catch and bycatch and the development of population simulation models to test future spatial-management arrangements for commercially-targeted whiskery and gummy shark stocks.','McAuley, R. 2011. Western Australia Government Shark Tracking','Rory McAuley','WA Fish','rory.mcauley@dpird.wa.gov.au','http://members.oceantrack.org/data/discovery/WST.htm','ACOUSTIC TRANSMITTERS; ; EARTH SCIENCE > BIOLOGICAL CLASSIFICATION > ANIMALS/VERTEBRATES > FISH','GCMD','By accessing or using OTN Data you agree to: a) give proper attribution to all Data Providers and to OTN by using the preformed citations contained in OTN metadata reports and in the data records, b) inform OTN of publications, products or commercial applications using the data, c) acknowledge that neither the OTN nor the provider is liable for inaccuracies in the data, d) assume responsibility for investigating and understanding the limitations of the data, e) report all problems with respect to data to otndc@dal.ca. For full policy, see: http://members.oceantrack.org/policies/otn-data-policy-ver-11-oct-30','WGS84',113.11,121.66,-18.07,-35.11,0,95.479,'OTN-Global');
